import { useTranslation } from "react-i18next";
import { useSelector } from "react-redux";
import { useHistory } from "react-router";
import { useEffect } from "react";

import { ComponentHeaderAuth, StyledContainerSignIn } from "@components";
import { selectMerchant } from "@redux";
import { enumExternalMethod, PATH_SIGN_IN_EMAIL } from "@configs";
import { ModuleTelSignUp } from "@modules";

export const PageSignUpTel = () => {
    //page hook
    const { t } = useTranslation();
    const history = useHistory();
    //page variable
    const merchant = useSelector(selectMerchant);

    useEffect(() => {
        if (!merchant?.signUpSettings?.signUpMethods.includes(enumExternalMethod.TEL)) {
            history.push(PATH_SIGN_IN_EMAIL);
        }
    }, []);

    const handleSignIn = () => {
        history.push(PATH_SIGN_IN_EMAIL);
    };

    return (
        <StyledContainerSignIn color={merchant.themeColor}>
            <ComponentHeaderAuth />
            <ModuleTelSignUp />
            <div className="sign_in">
                {t("page.auth.already_have_an_account")}{" "}
                <span onClick={handleSignIn}>{t("page.auth.sign_in")}</span>
            </div>
        </StyledContainerSignIn>
    );
};
